import ACTIONS from './index'
import axios from 'axios'

export const dispatchLogin =()=>{
    return {
        type: ACTIONS.LOGIN 
    }
}

export const fetchUser = async ()=>{
    const res = await axios.get('/user/info',)
    return res
}
